:Never rdfs:comment Never is the only instance of the type NeverEver;
       This is a TimeInterval that cannot exist, because NeverEver is
      defined as disjoint with TimeInterval and therefore cannot overlap
      any real TimeInterval. Never can serve to represent
      the meaning of never in the ontology.

      The instance Never Corresponds approximately to adverb sense 1
        of never in WordNet:
        1. 255 never, neer - not ever; at no time in the past or future;
          I have never been to China; I shall never forget this day;
          had never seen a circus; never on Sunday; I will never marry you!
